import React, { component } from "react";

const styles = {
  title: {
    backgroundColor: "orange",
    width: 100,
    height: 100
  }
};

export class TodoMainTitle extends Component {
  render() {
    return <h6 style={styles.title}>{"Task manager"}</h6>;
  }
}

export default TodoMainTitle;
